import React from 'react';
import { useNavigate } from 'react-router-dom';

const SearchHistorySidebar = ({ searchHistory, isLoadingHistory, onSearchSelect }) => {
  const navigate = useNavigate();

  const handleScrapeContent = (url, title) => {
    const encodedUrl = encodeURIComponent(url);
    navigate(`/scrape/${encodedUrl}?title=${encodeURIComponent(title)}`);
  };

  const formatDate = (timestamp) => {
    const date = new Date(timestamp);
    const now = new Date();
    const diffTime = Math.abs(now - date);
    const diffDays = Math.ceil(diffTime / (1000 * 60 * 60 * 24));
    
    if (diffDays === 1) return 'Today';
    if (diffDays === 2) return 'Yesterday';
    if (diffDays <= 7) return `${diffDays - 1} days ago`;
    return date.toLocaleDateString();
  };

  const truncateText = (text, maxLength = 60) => {
    if (text.length <= maxLength) return text;
    return text.substring(0, maxLength) + '...';
  };

  return (
    <div className="w-80 bg-white border-r border-gray-200 h-screen overflow-y-auto sticky top-0">
      <div className="p-4 border-b border-gray-200 bg-gray-50">
        <h2 className="text-lg font-bold text-gray-800 flex items-center gap-2">
          📚 Search History
        </h2>
        <p className="text-sm text-gray-600 mt-1">
          {searchHistory.length} recent searches
        </p>
      </div>

      <div className="p-4">
        {isLoadingHistory ? (
          <div className="text-center py-8">
            <div className="animate-spin rounded-full h-6 w-6 border-b-2 border-blue-600 mx-auto mb-3"></div>
            <p className="text-sm text-gray-600">Loading history...</p>
          </div>
        ) : searchHistory.length === 0 ? (
          <div className="text-center py-8">
            <div className="text-4xl mb-3">🔍</div>
            <p className="text-sm text-gray-600">No search history yet</p>
            <p className="text-xs text-gray-500 mt-1">Your searches will appear here</p>
          </div>
        ) : (
          <div className="space-y-4">
            {searchHistory.map((search, index) => (
              <div key={index} className="border border-gray-200 rounded-lg p-3 hover:shadow-sm transition-shadow">
                {/* Search Header */}
                <div className="mb-3">
                  <button
                    onClick={() => onSearchSelect && onSearchSelect(search.query)}
                    className="text-left w-full group"
                  >
                    <h3 className="font-medium text-gray-800 text-sm group-hover:text-blue-600 transition-colors">
                      🔍 "{truncateText(search.query, 35)}"
                    </h3>
                    <div className="text-xs text-gray-500 mt-1 flex items-center gap-2">
                      <span>📊 {search.results?.length || 0} results</span>
                      <span>•</span>
                      <span>{formatDate(search.timestamp)}</span>
                    </div>
                  </button>
                </div>
                
                {/* Top Results Preview */}
                {search.results && search.results.length > 0 && (
                  <div className="space-y-2">
                    {search.results.slice(0, 2).map((result, resultIndex) => (
                      <div key={resultIndex} className="bg-gray-50 rounded p-2 border border-gray-100">
                        <h4 className="text-xs font-medium text-gray-700 mb-1 leading-tight">
                          {truncateText(result.title, 50)}
                        </h4>
                        <p className="text-xs text-gray-600 mb-2 leading-tight">
                          {truncateText(result.snippet, 80)}
                        </p>
                        
                        {/* Mini Action Buttons */}
                        <div className="flex gap-1">
                          <button
                            onClick={() => handleScrapeContent(result.link, result.title)}
                            className="bg-green-500 hover:bg-green-600 text-white text-xs py-1 px-2 rounded transition-colors flex items-center gap-1"
                            title="Scrape this content"
                          >
                            🔍
                          </button>
                          <a
                            href={result.link}
                            target="_blank"
                            rel="noopener noreferrer"
                            className="bg-blue-500 hover:bg-blue-600 text-white text-xs py-1 px-2 rounded transition-colors"
                            title="Open link"
                          >
                            →
                          </a>
                        </div>
                      </div>
                    ))}
                    
                    {/* Show more indicator */}
                    {search.results.length > 2 && (
                      <div className="text-center">
                        <button
                          onClick={() => onSearchSelect && onSearchSelect(search.query)}
                          className="text-xs text-blue-600 hover:text-blue-800 hover:underline"
                        >
                          +{search.results.length - 2} more results
                        </button>
                      </div>
                    )}
                  </div>
                )}
              </div>
            ))}
          </div>
        )}
      </div>
    </div>
  );
};

export default SearchHistorySidebar;
